using System;
using AlloyTemplates.Models.Blocks;
using AlloyTemplates.Models.Media;
using EPiServer.Core;
using EPiServer.DataAbstraction;
using EPiServer.Framework.Blobs;
using EPiServer.Framework.Cache;

namespace Toders.VisualTests.StaticContent.Content.Assets
{
    public class AssetProvider : ContentProviderBase
    {
        private readonly IBlobFactory _blobFactory;

        public AssetProvider(
            ContentFolder entryPoint,
            IContentTypeRepository contentTypeRepository,
            IObjectInstanceCache objectInstanceCache,
            IBlobFactory blobFactory)
            : base(entryPoint, 150000, contentTypeRepository, objectInstanceCache)
        {
            _blobFactory = blobFactory;
        }

        public AssetModel Assets { get; set; } = new AssetModel();

        protected override void Initialize()
        {
            var teasersFolder = Create<ContentFolder>(Tree, "Teasers Folder");
            var mediaFolder = Create<ContentFolder>(Tree, "Media Folder");

            var image = Create<ImageFile>(
                mediaFolder,
                "Teaser Image.png",
                file =>
                {
                    var blob = new Base64Blob(
                        file.BinaryDataContainer,
                        "data:image/png;base64,");
                    file.BinaryData = blob;
                    file.Thumbnail = blob;
                });
            Assets.Image = image.ContentLink;

            var fullTeaser = Create<TeaserBlock>(
                teasersFolder,
                "Teaser 1",
                block =>
                {
                    block.Heading = "A Teaser";
                    block.Text = "This is an example teaser";
                    block.Image = image.ContentLink;
                });
            Assets.Teasers.Add(fullTeaser.ContentLink);

        }
    }

    public class Base64Image
    {
        private readonly string extension;

        private readonly string mime;

        private readonly string data;

        public Base64Image(string base64String)
        {
            int indexOfSemicolon = base64String.IndexOf(";", System.StringComparison.Ordinal);
            if (indexOfSemicolon < 0 && indexOfSemicolon < base64String.Length)
            {
                return;
            }

            string leftOfSemicolon = base64String.Substring(0, indexOfSemicolon);
            if (string.IsNullOrWhiteSpace(leftOfSemicolon))
            {
                return;
            }

            int indexOfColon = leftOfSemicolon.IndexOf(":", System.StringComparison.Ordinal);
            if (indexOfColon < 0 && indexOfColon < leftOfSemicolon.Length)
            {
                return;
            }

            string rightOfColon = leftOfSemicolon.Substring(indexOfColon + 1);
            int indexOfSlash = rightOfColon.IndexOf("/", System.StringComparison.Ordinal);
            if (indexOfSlash < 0 && indexOfSlash < rightOfColon.Length)
            {
                return;
            }

            var rightOfSlash = rightOfColon.Substring(indexOfSlash + 1);

            string rightOfSemicolon = base64String.Substring(0 + 1);
            if (string.IsNullOrWhiteSpace(rightOfSemicolon))
            {
                return;
            }

            int indexOfComma = rightOfSemicolon.IndexOf(",", System.StringComparison.Ordinal);
            if (indexOfComma < 0)
            {
                return;
            }

            string rightOfComma = rightOfSemicolon.Substring(indexOfComma + 1);

            this.mime = rightOfColon;
            this.extension = rightOfSlash;
            this.data = rightOfComma;
        }

        public string Extension
        {
            get
            {
                return this.extension;
            }
        }

        public string Mime
        {
            get
            {
                return this.mime;
            }
        }

        public byte[] Bytes
        {
            get
            {
                return Convert.FromBase64String(this.data);
            }
        }

        public string Data
        {
            get
            {
                return this.data;
            }
        }
    }
}
